import React from 'react'
import PropTypes from 'prop-types'

const InputField = ({state, setState}) => {

    const handleChange = (e) => {
        setState(e.target.value);
    }

    return (
        <form>
            <input 
                type = "number"
                value = {state}
                onChange = { handleChange }
            />
        </form>
    )
}

InputField.propTypes = {

}

export default InputField
